SELECT "RealEstate1_2"."County" AS "County",   SUM(CAST("RealEstate1_2"."Number of Records" AS BIGINT)) AS "sum:Number of Records:ok" FROM "RealEstate1_2" WHERE ((CAST("RealEstate1_2"."Date of Transfer" as DATE) >= cast('2005-01-01' as DATE)) AND (CAST("RealEstate1_2"."Date of Transfer" as DATE) <= cast('2015-03-31' as DATE)) AND (CAST("RealEstate1_2"."Calculation_5480628224156393" as DATE) >= cast('2005-01-01' as DATE)) AND (CAST("RealEstate1_2"."Calculation_5480628224156393" as DATE) <= cast('2015-03-31' as DATE)) AND (CAST("RealEstate1_2"."Date of Transfer" as DATE) >= cast('1995-01-01' as DATE)) AND (CAST("RealEstate1_2"."Date of Transfer" as DATE) <= cast('2015-03-31' as DATE)) AND (CAST(EXTRACT(YEAR FROM "RealEstate1_2"."Date of Transfer") AS BIGINT) IN (2005, 2006, 2007, 2008, 2009, 2010, 2011, 2012, 2013, 2014))) GROUP BY "County";
